The mina-fungible-token repo's e2e example showcases the entire lifecycle of a token. After running npm i mina-fungible-token, import the FungibleToken and FungibleTokenAdmin contracts and deploy them: const token = new FungibleToken(contract.publicKey)
const adminContract = new FungibleTokenAdmin(admin.publicKey) const deployTx = await Mina.transaction({ sender: deployer, fee,
}, async () => { AccountUpdate.fundNewAccount(deployer, 2) await adminContract.deploy({ adminPublicKey: admin.publicKey }) await token.deploy({ admin: admin.publicKey, symbol: "abc", src: "https://github.com/MinaFoundation/mina-fungible-token/blob/main/examples/e2e.eg.ts", decimals: UInt8.from(9), })
})
await deployTx.prove()
deployTx.sign([deployer.key, contract.privateKey, admin.privateKey])
await deployTx.send() Note: this example assumes that contract and deployer are valid key pairs in scope.

