The following events are emitted from FungibleToken when appropriate: events = { SetAdmin: SetAdminEvent, Pause: PauseEvent, Mint: MintEvent, Burn: BurnEvent, Transfer: TransferEvent,
} export class SetAdminEvent extends Struct({ adminKey: PublicKey,
}) {} export class PauseEvent extends Struct({ isPaused: Bool,
}) {} class MintEvent extends Struct({ recipient: PublicKey, amount: UInt64,
}) {} class BurnEvent extends Struct({ from: PublicKey, amount: UInt64,
}) {} class TransferEvent extends Struct({ from: PublicKey, to: PublicKey, amount: UInt64,
}) {} Note that approveBase does not emit an event. Thus, transfers where the account updates have been constructed externally to FungibleToken will not have an event emitted by the FungibleToken contract.

